import logo from './logo.svg';
import './App.css';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <Routes>
      <Route path='/' element={<div>Hello</div>} />
      <Route path='/about-us' element={<div>Hello</div>} />
      <Route path='/contact-us' element={<div>Hello</div>} />
      <Route path='/Drive-with-assar' element={<div>Hello</div>} />
      <Route path='/Franchise' element={<div>Hello</div>} />
      <Route path='/login' element={<div>Hello</div>} />
      <Route path='/Create-account' element={<div>Hello</div>} />
      <Route path='/forget-password' element={<div>Hello</div>}/>
      <Route path='/Blogs' element={<div>Hello</div>} />
      <Route path='/Blogdetail' element={<div>Hello</div>} />
      <Route path='/Notics' element={<div>Hello</div>} />
      <Route path='/Business-Solutions' element={<div>Hello</div>} />
    </Routes>
  );
}

export default App;
